import React, { useState } from 'react';
import "./index.css";

const App = () => {

  return (
    <>
      <h1>Hello {fullName.fname} {fullName.lname} </h1>
      <p>{fullName.gmail}</p>
      <p>{fullName.password}</p>
      <p>{fullName.mobile}</p>
      <form action="" onSubmit={subNow}>
      <input type="text"
        placeholder="Enter Your Name"
        name="fname"
        onChange={inputEvent}
        value={fullName.fname}
      />
       <br />
      <br />
      <input type="text"
        placeholder="Enter Your Name"
        name="lname"
        onChange={inputEvent}
        value={fullName.lname}
      />
       <br />
       <br />
      <input type="gmail"
        placeholder="Enter Your Gmail"
        name="gmail"
        onChange={inputEvent}
        value={fullName.gmail}
      />
       <br />
       <br />
      <input type="password"
        placeholder="Enter Your password"
        name="password"
        onChange={inputEvent}
        value={fullName.password}
      />
       <br />
       <br />
      <input type="text"
        placeholder="Enter Your Mobile"
        name="mobile"
        onChange={inputEvent}
        value={fullName.mobile}
      />
      <br />
      <br />
      <button >submit</button>
      </form>
    </>
  )
}

export default App;
